import React from "react";
import {
  MDBContainer,
  MDBNavbar,
  MDBBtn,
  MDBInputGroup,
} from "mdb-react-ui-kit";

export default function App() {
  return (
    <MDBNavbar dark bgColor="dark">
      <MDBContainer fluid>
        <MDBInputGroup tag="form" className="d-flex w-auto mb-3">
          {/*     <input
            className="form-control"
            placeholder="Type query"
            aria-label="Search"
            type="Search"
          /> */}
          <MDBBtn outline>Quienes somos?</MDBBtn>
          <MDBBtn outline>Servicios</MDBBtn>
          <MDBBtn outline>Postulate</MDBBtn>
        </MDBInputGroup>
      </MDBContainer>
    </MDBNavbar>
  );
}
